nashville, tenn. (ap) ‚Äî tennessee gov. #billhaslam has granted clemency to a woman serving a life sentence for murder who says she was a victim of #sextrafficking.

haslam said monday that he would show mercy to the now 30-year-old #cyntoiabrown by releasing her aug. 7. she will remain on parole for 10 years.

brown said in a statement that she will do everything to justify haslam‚Äôs faith in her and thanked her family for their support.

kim kardashian west, rihanna, and other celebrities rallied for brown as she fought her life sentence for the 2004 murder of a man who had picked her up for sex. she was 16 years old at the time. her lawyers say she was a sex-trafficking victim and feared for her life.
